import React from "react";
import { Nav, NavLink, NavMenu }
  from "./NavbarElements";


const Navbar = () => {
  return (
    <>
      <Nav>
        <NavMenu className="nav-menue">
          <picture>
            <source media="(min-width: 32px) (min-height: 32px)" src="hsalogo.png" />
            <img src="imgs/hsalogo.png" alt="hsa_logo" styleName='hsa-logo' />
          </picture>
          <NavLink to="/index" activeStyle>
            Startseite
          </NavLink>
          <NavLink to="/about" activeStyle>
            About
          </NavLink>
          <NavLink to="/help" activeStyle>
            Help
          </NavLink>
        </NavMenu>
      </Nav>
    </>
  );
};

export default Navbar;
